import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Analytics from "./components/Analytics";
import Newsletter from "./components/Newsletter";
import Cards from "./components/Cards";

function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Analytics />
      <Newsletter />

      <Cards
        customStyle="bg-[#00df9a] w-[200px] rounded-md font-medium my-6 mx-auto px-6 py-3"
        price="149$"
      />
      <Cards customStyle="bg-black w-[200px] rounded-md font-medium my-6 mx-auto px-6 py-3 text-[#00df9a]" />
      <Cards customStyle="bg-[#00df9a] w-[200px] rounded-md font-medium my-6 mx-auto px-6 py-3" />
    </div>
  );
}

export default App;
